import React from 'react';
import {Redirect} from 'react-router-dom';
import {Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink, UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';
//import LogoNavbar from "./img/logo-navbar.png";

const LogoNavbar = 'data:image/png;base64,';

var username = '';
var urlActual = '';

class NavBarMain extends React.Component {

  constructor(props) {
    super(props);

    const { location, match } = props;

    urlActual = match.url.split("/", 2);

    username = match.params.id_Usuario;

    this.toggle = this.toggle.bind(this);
    this.redireccionarIrNuevaVenta = this.redireccionarIrNuevaVenta.bind(this);
    this.redireccionarIrModificarVenta = this.redireccionarIrModificarVenta.bind(this);
    this.redireccionarIrVentasConcluidas = this.redireccionarIrVentasConcluidas.bind(this);
    this.redireccionarIrVentasCanceladas = this.redireccionarIrVentasCanceladas.bind(this);
    this.redireccionarIrClientes= this.redireccionarIrClientes.bind(this);
    this.redireccionarIrOrigenesyDestinos = this.redireccionarIrOrigenesyDestinos.bind(this);
    this.redireccionarIrCamiones = this.redireccionarIrCamiones.bind(this);
    this.redireccionarIrTripulantes = this.redireccionarIrTripulantes.bind(this);
    this.redireccionarIrViajes= this.redireccionarIrViajes.bind(this);
    this.redireccionarIrCorte= this.redireccionarIrCorte.bind(this);
    this.redireccionarIrPublicidad = this.redireccionarIrPublicidad.bind(this);
    this.redireccionarIrConfigurarViajes = this.redireccionarIrConfigurarViajes.bind(this);
    this.redireccionarIrDescuentos = this.redireccionarIrDescuentos.bind(this);
    this.redireccionarIrRutas = this.redireccionarIrRutas.bind(this);
    this.redireccionarIrPrecios = this.redireccionarIrPrecios.bind(this);
    this.redireccionarIrPrecios = this.redireccionarIrPrecios.bind(this);
    this.redireccionarIrNuevaReservacion = this.redireccionarIrNuevaReservacion.bind(this);
    this.redireccionarIrReservacionesConcluidas = this.redireccionarIrReservacionesConcluidas.bind(this);
    this.redireccionarIrModificarReservacion = this.redireccionarIrModificarReservacion.bind(this);
    this.redireccionarIrReservacionesCanceladas = this.redireccionarIrReservacionesCanceladas.bind(this);
    this.redireccionarIrConfigurarPrecios = this.redireccionarIrConfigurarPrecios.bind(this);
    this.redireccionarIrListaAbordaje = this.redireccionarIrListaAbordaje.bind(this);
    this.redireccionarIrListaNegra = this.redireccionarIrListaNegra.bind(this);
    

    this.fetchUser = this.fetchUser.bind(this);
    this.fetchViajeRedondo = this.fetchViajeRedondo.bind(this);
    
    this.state = {isOpen: false, IrNuevaVenta:false, IrModificarVenta:false, IrLogin:false, IrVentasConcluidas:false, IrVentasCanceladas:false, IrClientes:false, IrOrigenesyDestinos:false, IrCamiones:false, IrTripulantes:false, IrViajes:false, IrCorte:false, IrConfigurarViajes:false, IrRutas:false, IrConfigurarPrecios:false, IrPrecios:false, IrPublicidad:false,IrDescuentos:false, nombre: '', apellidoPaterno: '', apellidoMaterno: '', IrViajeRedondo:false, IrNuevaReservacion:false, IrModificarReservacion:false, IrReservacionesConcluidas:false, IrReservacionesCanceladas:false, IrListaAbordaje:false, IrListaNegra:false, urlActual: urlActual[1]}};

    componentDidMount(){
      this.fetchUser();
      this.fetchViajeRedondo();
    }

    fetchUser(){
      fetch(`/api/Usuarios/${username}`)
        .then(res => res.json())
        .then(data => {
            console.log(data);
            this.setState({
              nombre: data[0].nombre,
              apellidoPaterno: data[0].apellidoPaterno,
              apellidoMaterno: data[0].apellidoMaterno
            })
        });
    }

    fetchViajeRedondo(){
      fetch(`/api/Usuarios/${username}/descViajeRedondo`)
        .then(res => res.json())
        .then(data => {
            this.setState({
              viajeRedondo: data.res
            });
        });
    }

    redireccionarIrNuevaVenta(e){ e.preventDefault(); this.setState({IrNuevaVenta:true})};
    redireccionarIrModificarVenta(e){ e.preventDefault(); this.setState({IrModificarVenta:true})};
    redireccionarIrVentasConcluidas(e){ e.preventDefault(); this.setState({IrVentasConcluidas:true})};
    redireccionarIrVentasCanceladas(e){ e.preventDefault(); this.setState({IrVentasCanceladas:true})};
    redireccionarIrClientes(e){ e.preventDefault(); this.setState({IrClientes:true})};
    redireccionarIrOrigenesyDestinos(e){ e.preventDefault(); this.setState({IrOrigenesyDestinos:true})};
    redireccionarIrCamiones(e){ e.preventDefault(); this.setState({IrCamiones:true})};
    redireccionarIrTripulantes(e){ e.preventDefault(); this.setState({IrTripulantes:true})};
    redireccionarIrViajes(e){ e.preventDefault(); this.setState({IrViajes:true})};
    redireccionarIrCorte(e){ e.preventDefault(); this.setState({IrCorte:true})};
    redireccionarIrConfigurarViajes(e){ e.preventDefault(); this.setState({IrConfigurarViajes:true})};
    redireccionarIrPublicidad(e){ e.preventDefault(); this.setState({IrPublicidad:true})};
    redireccionarIrLogin(e){ e.preventDefault(); this.setState({IrLogin:true})};
    redireccionarIrConfigurarViajes(e){ e.preventDefault(); this.setState({IrConfigurarViajes:true})};
    redireccionarIrDescuentos(e){ e.preventDefault(); this.setState({IrDescuentos:true})};
    redireccionarIrViajeRedondo(e){ e.preventDefault(); this.setState({IrViajeRedondo:true})};
    redireccionarIrRutas(e){e.preventDefault(); this.setState({IrRutas:true})};
    redireccionarIrPrecios(e){ e.preventDefault(); this.setState({IrPrecios:true})};
    redireccionarIrConfigurarPrecios(e){ e.preventDefault(); this.setState({IrConfigurarPrecios:true})}; 
    redireccionarIrNuevaReservacion(e){ e.preventDefault(); this.setState({IrNuevaReservacion:true})};
    redireccionarIrModificarReservacion(e){ e.preventDefault(); this.setState({IrModificarReservacion:true})};
    redireccionarIrReservacionesConcluidas(e){ e.preventDefault(); this.setState({IrReservacionesConcluidas:true})};
    redireccionarIrReservacionesCanceladas(e){ e.preventDefault(); this.setState({IrReservacionesCanceladas:true})};
    redireccionarIrListaAbordaje(e){ e.preventDefault(); this.setState({IrListaAbordaje:true})};
    redireccionarIrListaNegra(e){ e.preventDefault(); this.setState({IrListaNegra:true})};
    
    toggle() {this.setState({isOpen: !this.state.isOpen})};

  render() {
    if(this.state.IrCorte){return <Redirect to= {"/Viajes_Corte/"+username}/>};
    if(this.state.IrConfigurarViajes){return <Redirect to= {"/Viajes_ConfigurarViajes/"+username}/>};
    if(this.state.IrCamiones){return <Redirect to= {"/Viajes_Camiones/"+username}/>};//
    if(this.state.IrClientes){return <Redirect to= {"/Viajes_Clientes/"+username}/>};//
    if(this.state.IrNuevaVenta){return <Redirect to= {"/Viajes_Index/"+username}/>};//
    if(this.state.IrModificarVenta){return <Redirect to= {"/Viajes_ModificarVenta/"+username}/>};
    if(this.state.IrLogin){return <Redirect to= {"/"+username}/>};
    if(this.state.IrOrigenesyDestinos){return <Redirect to= {"/Viajes_OrigenesyDestinos/"+username}/>};//
    if(this.state.IrPublicidad){return <Redirect to= {"/Viajes_Publicidad/"+username}/>};
    if(this.state.IrTripulantes){return <Redirect to= {"/Viajes_Tripulantes/"+username}/>};
    if(this.state.IrUsuarios){return <Redirect to= {"/Viajes_Usuarios/"+username}/>};
    if(this.state.IrViajes){return <Redirect to= {"/Viajes_Viajes/"+username}/>};
    if(this.state.IrVentasConcluidas){return <Redirect to= {"/Viajes_VentasConcluidas/"+username}/>};
    if(this.state.IrVentasCanceladas){return <Redirect to= {"/Viajes_VentasCanceladas/"+username}/>};
    if(this.state.IrDescuentos){return <Redirect to= {"/Viajes_Descuentos/"+username}/>};
    if(this.state.IrRutas){return <Redirect to= {"/Viajes_Rutas/"+username}/>}
    if(this.state.IrConfigurarPrecios){return <Redirect to= {"/Viajes_ConfigurarPrecios/"+username}/>};
    if(this.state.IrPrecios){return <Redirect to= {"/Precios/"+username}/>};
    if(this.state.IrNuevaReservacion){return <Redirect to= {"/Viajes_NuevaReservacion/"+username}/>};//
    if(this.state.IrModificarReservacion){return <Redirect to= {"/Viajes_ModificarReservacion/"+username}/>};
    if(this.state.IrReservacionesConcluidas){return <Redirect to= {"/Viajes_ReservacionesConcluidas/"+username}/>};
    if(this.state.IrReservacionesCanceladas){return <Redirect to= {"/Viajes_ReservacionesCanceladas/"+username}/>};
    if(this.state.IrListaAbordaje){return <Redirect to= {"/Viajes_ListaAbordaje/"+username}/>};
    if(this.state.IrListaNegra){return <Redirect to= {"/Viajes_ListaNegra/"+username}/>};
   
    return (
      <div>
        <Navbar color="danger" dark expand="md" >
          <NavbarBrand href="/">
            <img src={LogoNavbar} width="auto" height="60" alt="logo-viajes_azteca"/>
          </NavbarBrand>
          <span class="navbar-text" style={{color: 'white'}}>
            {this.state.nombre+" "+this.state.apellidoPaterno+" "+this.state.apellidoMaterno}
          </span>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  VENTAS
                </DropdownToggle>
                <DropdownMenu left>

                {(this.state.urlActual == 'Viajes_Index')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrNuevaVenta}>
                        <NavLink className="text-dark"> NUEVA VENTA </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {
                  (this.state.viajeRedondo)? 
                    ((this.state.urlActual == 'ViajeRedondo')? 
                    ''
                    : 
                    (
                      <DropdownItem>
                        <NavItem onClick={this.redireccionarIrViajeRedondo}>
                            <NavLink className="text-dark"> NUEVA VENTA VIAJE REDONDO </NavLink>
                        </NavItem>
                      </DropdownItem>
                    ))
                  : 
                   ''                  
                }
                {(this.state.urlActual == 'Viajes_ModificarVenta')? 
                    ''
                    :
                    (
                      <DropdownItem>
                        <NavItem onClick={this.redireccionarIrModificarVenta}>
                            <NavLink className="text-dark"> MODIFICAR VENTA </NavLink>
                        </NavItem>
                      </DropdownItem>
                    )
                }
                {(this.state.urlActual == 'Viajes_VentasConcluidas')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrVentasConcluidas}>
                        <NavLink className="text-dark"> VENTAS CONCLUIDAS </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_VentasCanceladas')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrVentasCanceladas}>
                        <NavLink className="text-dark"> VENTAS CANCELADAS </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                </DropdownMenu>
              </UncontrolledDropdown>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  RESERVACIONES
                </DropdownToggle>
                <DropdownMenu left>
                {(this.state.urlActual == 'Viajes_NuevaReservacion')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrNuevaReservacion}>
                        <NavLink className="text-dark"> NUEVA RESERVACION </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_ModificarReservacion')? 
                    ''
                    :
                    (
                      <DropdownItem>
                        <NavItem onClick={this.redireccionarIrModificarReservacion}>
                            <NavLink className="text-dark"> MODIFICAR RESERVACION </NavLink>
                        </NavItem>
                      </DropdownItem>
                    )
                  }
                {(this.state.urlActual == 'Viajes_ReservacionesConcluidas')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrReservacionesConcluidas}>
                        <NavLink className="text-dark"> RESERVACIONES CONCLUIDAS </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_ReservacionesCanceladas')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrReservacionesCanceladas}>
                        <NavLink className="text-dark"> RESERVACIONES CANCELADAS </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }

                </DropdownMenu>
              </UncontrolledDropdown>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  VER
                </DropdownToggle>
                <DropdownMenu left>

                {(this.state.urlActual == 'Viajes_Clientes')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrClientes}>
                        <NavLink className="text-dark"> CLIENTES </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_OrigenesyDestinos')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrOrigenesyDestinos}>
                        <NavLink className="text-dark"> ORIGENES Y DESTINOS </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_Camiones')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrCamiones}>
                        <NavLink className="text-dark"> CAMIONES </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_Tripulantes')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrTripulantes}>
                        <NavLink className="text-dark"> TRIPULANTES </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_Viajes')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrViajes}>
                        <NavLink className="text-dark"> VIAJES </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                </DropdownMenu>
              </UncontrolledDropdown>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  LISTAS
                </DropdownToggle>
                <DropdownMenu right>

                {(this.state.urlActual == 'Viajes_ListaAbordaje')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem  onClick={this.redireccionarIrListaAbordaje}>
                        <NavLink className="text-dark">LISTA DE ABORDAJE</NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_ListaNegra')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrListaNegra}>
                        <NavLink className="text-dark"> LISTA NEGRA </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }

                </DropdownMenu>
              </UncontrolledDropdown>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  CORTE
                </DropdownToggle>
                <DropdownMenu>
                {(this.state.urlActual == 'Viajes_Corte')?
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrCorte}>
                        <NavLink className="text-dark"> CORTE </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                </DropdownMenu>
              </UncontrolledDropdown>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  VIAJES
                </DropdownToggle>
                <DropdownMenu left>
                {(this.state.urlActual == 'Viajes_ConfigurarViajes')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrConfigurarViajes}>
                        <NavLink className="text-dark"> CONFIGURAR VIAJES </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                {(this.state.urlActual == 'Viajes_Rutas')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrRutas}>
                        <NavLink className="text-dark"> RUTAS </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                </DropdownMenu>
              </UncontrolledDropdown>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  OPCIONES
                </DropdownToggle>
                <DropdownMenu right>

                {(this.state.urlActual == 'Viajes_Publicidad')? 
                ''
                :
                (
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrPublicidad}>
                        <NavLink className="text-dark"> PUBLICIDAD </NavLink>
                    </NavItem>
                  </DropdownItem>
                )
                }
                  <DropdownItem>
                  {(this.state.urlActual == 'Viajes_Descuentos')? 
                  ''
                  :
                  (
                    <NavItem onClick={this.redireccionarIrDescuentos}>
                        <NavLink className="text-dark"> DESCUENTOS </NavLink>
                    </NavItem>
                  )
                  }
                  </DropdownItem>
                  {(this.state.urlActual == 'Viajes_ConfigurarPrecios')? 
                  ''
                  :
                  (
                    <DropdownItem>
                      <NavItem onClick={this.redireccionarIrConfigurarPrecios}>
                          <NavLink className="text-dark"> CONFIGURAR PRECIOS</NavLink>
                      </NavItem>
                    </DropdownItem>
                  )
                  }
                  <DropdownItem>
                    <NavItem onClick={this.redireccionarIrLogin}>
                        <NavLink className="text-dark"> CERRAR SESION </NavLink>
                    </NavItem>
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
      </div>
    );
  }
}
export default NavBarMain